script: |
  super -f text -I q8854.spq | sort > q8854.out

inputs:
  - name: q8854.spq
    data: |
      SELECT + col1 * 25 / 98 / - 89 + col2 + col0 / col0 / + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 1 + - col2 * col1 NOT BETWEEN + - 94 * + + 3 AND col1 + - col0 + - col1 * 3;
  - name: tab1

outputs:
  - name: q8854.out
    data: |
      59
      68
      96
